import React from "react";
import "./HomeCard.css"

export default function HomeCard({temperature}){
    return(
        <div className="HomeCard">
            <div className="tittle"><h1>Tiempo en {temperature.name}</h1></div>
            <div className="temp">
            <h3>La temperatura es {temperature.temp} °C, se espera una minima de {temperature.temp_min} °C 
            y una Máxima de {temperature.temp_max} °C, su sensacion termica esta en {temperature.feels}, la presion {temperature.pressure} con humedad del {temperature.humidity}% y el dia se presenta con {temperature.description}.
            </h3>
            
            </div>
            <img src={"/icons/"+temperature.icon+".svg"} alt="" />
            <div><h1>PRINCIPALES CIUDADES ARGENTINAS</h1></div>
        </div>
    )
}
